def meanConfidenceInterval(data, confidence=0.95):
    a = 1.0 * np.array(data)
    n = len(a)
    m, se = np.mean(a), stats.sem(a)
    h = se * stats.t.ppf((1 + confidence) / 2., n-1)
    return m, h

# Calculate mean and confidence intervals for all datasets
def process_data(data):
    means = []
    errors = []
    for outer_list in data:
        inner_means = []
        inner_errors = []
        for inner_list in outer_list:
            m, h = meanConfidenceInterval(inner_list)
            inner_means.append(m)
            inner_errors.append(h)
        means.append(inner_means)
        errors.append(inner_errors)
    return means, errors

